description:
A twisted tale of forbidden love...
Brad Armstrong, creator of the epic love story Fallen and the runaway 2014 blockbuster Underworld, now delivers his follow-up masterpiece Aftermath, a twisted tale of forbidden love. Leading man Ryan Driller and XBIZ / XRCO Best Male Newcomer Tyler Nixon are father and son, three-time AVN Best Actress Winner jessica drake is the woman who loves them. Wicked Girl &amp; Performer of the year Asa Akira, Performer of the Year Bonnie Rotten, MILF superstar Brandi Love and Best Actor Winner Xander Corvus round out an amazing cast. An intensely powerful coming-of-age drama that explores and shatters sexual boundaries, Aftermath is destined to become an instant classic.

